             ['Psychiatric',
              u'hallucinationer, konfusion, s\xf6mnst\xf6rningar, oro och mardr\xf6mmar. Psykiska biverkningar kan f\xf6rekomma efter administrering av Nobligan. Dessa varierar fr\xe5n individ till individ med avseende p\xe5 sv\xe5righetsgrad och art (beroende p\xe5 personlighet och behandlingstid). H\xe4r kan n\xe4mnas f\xf6r\xe4ndringar av sinnesst\xe4mning (vanligen upprymdhet, ibland dysfori), aktivitetsf\xf6r\xe4ndringar (vanligen d\xe4mpning, ibland \xf6kning) och f\xf6r\xe4ndringar av kognitiv och sensorisk kapacitet (t ex f\xf6rm\xe5ga att fatta beslut, uppfattningsf\xf6rm\xe5ga). Tramadol kan ge upphov till beroende. Symtom p\xe5 abstinensbesv\xe4r, liknande de som f\xf6rekommer i samband med opiatavv\xe4njning, kan visa sig p\xe5 f\xf6ljande s\xe4tt: upphetsning, \xe4ngslan, nervositet, s\xf6mnl\xf6shet, hyperkinesi, darrningar och gastrointestinala rubbningar. Andra symptom som mycket s\xe4llan har observerats i samband med avbrytande av tramadolbehandling inkluderar: panikattacker, sv\xe5r \xe5ngest, hallucinationer, parestesier, tinnitus samt ovanliga CNS-symptom (t ex konfusion, vanf\xf6rest\xe4llning, depersonalisering, derealisation, paranoia).'],
